  return (
    <BrowserRouter>
      <Switch>

        <Route path='/pagina-inicial' exact component={Dashboard} />
        <Route path='*' exact component={() => <Redirect to='/pagina-inicial' />} />
        <Route path='*' exact component={() => <Redirect to='/pagina-inicial' />} />


      </Switch>
    </BrowserRouter>
  );
}
